import React, { Component } from 'react'

export default class Tweets extends Component {

    constructor(props){
        super(props);
        this.state = {
            tweets: ""
        }
    }

    componentWillReceiveProps(newProps){
        this.setState({ tweets: nextProps.tweets })
    }

    render() {
        return (
            <div>
               <p>Tweets {this.state.tweets}</p>
            </div>
        )
    }
}
